angular.module("mainApp").filter("numberFixedLen",function(){return function(c,a){var b=parseInt(c,10);a=parseInt(a,10);if(isNaN(b)||isNaN(a)){return c}b=""+b;while(b.length<a){b="0"+b}return b}});angular.module("mainApp").filter("range",function(){return function(a,b){sum=parseInt(b);for(i=1;i<sum+1;i++){a.push(i)}return a}});angular.module("mainApp").filter("rangeFromTO",function(){return function(a,c,b){sum=parseInt(b);for(i=c;i<sum+1;i++){a.push(i)}return a}});